import {Routes, Route} from "react-router-dom"
import './App.css';

function App() {
  return (
    <div className="App">
    <Routes>
    <Route path="/" element={<Home/>}/>
    <Route path="/about" element={<About/>}/>
    <Route path="/korzinka" element={<Korzinka/>}/>
</Routes>
    </div>
  );
}

export default App;
